import React from 'react'
import styled from 'styled-components'

const IntroText = styled.div`
    padding-left: 30px;
    font-size: 18px;
    color: gray;
`

const AssignBox = styled.div`
    display: flex;
    flex-direction: row;

`

function MyAssignment() {
    return (
        <>
          <IntroText>
            내용을 클릭하면 해당페이지로 이동합니다.    
          </IntroText>  
          <AssignBox></AssignBox>
        </>
    )
}

export default MyAssignment
